import React, { Component } from 'react';
import { Map as LeafletMap, TileLayer, Marker, Popup } from 'react-leaflet';
import classes from './Map.module.css';



class Map extends Component {
    render(){
        return(
            <div className={classes.leafletContainer}>
                <LeafletMap
                    center={[50, 10]}
                    zoom={6}
                    maxZoom={10}
                    >
                </LeafletMap>
            </div>
        )
    }
}

export default Map;
